/*Table structure for table `persona` */

DROP TABLE IF EXISTS `persona`;

CREATE TABLE `persona` (
  `codi_iden` varchar(60) DEFAULT NULL,
  `id` varchar(60) NOT NULL COMMENT 'Campo que almacena la identificación de la persona',
  `nomb_pers` varchar(60) NOT NULL COMMENT 'Campo que almacena los nombres de la persona',
  `ape_pers` varchar(60) NOT NULL COMMENT 'Campo que almacena los apellidos de la persona',
  `sexo` char(2) DEFAULT NULL COMMENT 'Campo que almacena el sexo de la persona',
  `fnac_pers` date DEFAULT NULL COMMENT 'Campo que almacena la fecha de nacimiento de la persona',
  `esta_pers` int(11) DEFAULT NULL COMMENT 'Campo que almacena el estado civil de la persona',
  `telefono1` varchar(200) DEFAULT NULL COMMENT 'Campo que almacena telefono de la persona',
  `telefono2` varchar(200) DEFAULT NULL COMMENT 'Campo que almacena telefono de la persona',
  `emai_pers` varchar(300) DEFAULT NULL COMMENT 'Campo que almacena el email o correo de la persona',
  `direccion` varchar(300) DEFAULT NULL COMMENT 'Campo que almacena la dirección de la persona',
  `foto_pers` varchar(50) DEFAULT NULL COMMENT 'Campo que almacena la foto de persona',
  `certificado_v` varchar(300) DEFAULT NULL COMMENT 'Camppo que almacena el certificado de vecindad',
  `id_cat` int(11) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL COMMENT 'Campo que almacena la fecha en que la persona se registro en el sistema',
  `updated_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `FK_personas` (`esta_pers`),
  KEY `FK_personas_tipo_identificacion` (`codi_iden`),
  KEY `FK_persona_tbl_cat_persona` (`id_cat`),
  CONSTRAINT `FK_persona_estadocivil` FOREIGN KEY (`esta_pers`) REFERENCES `estado_civil` (`esta_pers`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `FK_persona_t_iden` FOREIGN KEY (`codi_iden`) REFERENCES `tipo_identificacion` (`codi_iden`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `FK_persona_tbl_cat_persona` FOREIGN KEY (`id_cat`) REFERENCES `cat_persona` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `FK_persona_users` FOREIGN KEY (`id`) REFERENCES `users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `persona` */

