/*Table structure for table `persona_datos_academicos` */

DROP TABLE IF EXISTS `persona_datos_academicos`;

CREATE TABLE `persona_datos_academicos` (
  `cod_da` int(11) NOT NULL AUTO_INCREMENT,
  `id` varchar(60) NOT NULL,
  `nivel_educativo` int(11) DEFAULT '8' COMMENT 'Descripción del nivel educativo',
  `titulo` varchar(300) DEFAULT NULL COMMENT 'Titulo obtenido',
  `institucion` varchar(300) DEFAULT NULL,
  `estado` varchar(100) DEFAULT NULL COMMENT 'Esatado del nivel educativo',
  `grado` date DEFAULT NULL,
  `soporte` varchar(300) DEFAULT NULL COMMENT 'Soporte del titulo',
  PRIMARY KEY (`cod_da`),
  KEY `FK_persona_datos_academicos_persona` (`id`),
  KEY `FK_persona_datos_academicos_tipo_estudios` (`nivel_educativo`),
  CONSTRAINT `FK_persona_datos_academicos_persona` FOREIGN KEY (`id`) REFERENCES `persona` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `FK_persona_datos_academicos_tipo_estudios` FOREIGN KEY (`nivel_educativo`) REFERENCES `tipo_estudio` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=255 DEFAULT CHARSET=utf8;

/*Data for the table `persona_datos_academicos` */

