/*Table structure for table `persona_datos_profesionales` */

DROP TABLE IF EXISTS `persona_datos_profesionales`;

CREATE TABLE `persona_datos_profesionales` (
  `cod_dp` int(11) NOT NULL AUTO_INCREMENT,
  `id` varchar(60) DEFAULT NULL,
  `titulo` varchar(300) DEFAULT NULL,
  `id_categoria` int(11) DEFAULT NULL,
  `id_perfil` int(11) DEFAULT NULL,
  `descripcion` varchar(300) DEFAULT NULL COMMENT 'Descripcion del perfil profesional',
  `estado` varchar(30) DEFAULT '0',
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  PRIMARY KEY (`cod_dp`),
  KEY `FK_persona_datos_profesionales_persona` (`id`),
  KEY `FK_persona_datos_profesionales_perfil` (`id_perfil`),
  KEY `FK_persona_datos_profesionales_cat` (`id_categoria`),
  CONSTRAINT `FK_persona_datos_profesionales_cat` FOREIGN KEY (`id_categoria`) REFERENCES `cat_laboral` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `FK_persona_datos_profesionales_perfil` FOREIGN KEY (`id_perfil`) REFERENCES `perfil_lab` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `FK_persona_datos_profesionales_persona` FOREIGN KEY (`id`) REFERENCES `persona` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=258 DEFAULT CHARSET=utf8;

