/*Table structure for table `persona_experiencia_profesional` */

DROP TABLE IF EXISTS `persona_experiencia_profesional`;

CREATE TABLE `persona_experiencia_profesional` (
  `cod_ep` int(11) NOT NULL AUTO_INCREMENT,
  `id` varchar(60) NOT NULL,
  `nomb_empresa` varchar(300) DEFAULT NULL COMMENT 'Nombre de la empresa donde laboró',
  `cargo` varchar(300) DEFAULT NULL COMMENT 'Cargo que desempeñó durante el tiempo que laboró',
  `funciones` varchar(300) DEFAULT NULL COMMENT 'Funciones que desarrollo durante el tiempo que laboró',
  `fecha_ini` date DEFAULT NULL COMMENT 'Fecha en la que inicio a laborar',
  `fecha_fin` date DEFAULT NULL COMMENT 'Fecha en la que cuminó labores',
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  PRIMARY KEY (`cod_ep`),
  KEY `FK_persona_experiencia_profesional_persona` (`id`),
  CONSTRAINT `FK_persona_experiencia_profesional_persona` FOREIGN KEY (`id`) REFERENCES `persona` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=256 DEFAULT CHARSET=utf8;

