/*Table structure for table `tipo_de_contrato` */

DROP TABLE IF EXISTS `tipo_de_contrato`;

CREATE TABLE `tipo_de_contrato` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `descripcion` varchar(300) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;

/*Data for the table `tipo_de_contrato` */

LOCK TABLES `tipo_de_contrato` WRITE;

insert  into `tipo_de_contrato`(`id`,`descripcion`) values (1,'Contrato a término indefinido'),(2,'Contrato de obra o labor'),(3,'Contrato a término fijo'),(4,'Contrato civil por prestación de servicios'),(5,'Contrato de aprendizaje'),(6,'Contrato ocasional de trabajo');

UNLOCK TABLES;

/*Table structure for table `tipo_estudio` */

DROP TABLE IF EXISTS `tipo_estudio`;

CREATE TABLE `tipo_estudio` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `descripcion` varchar(25) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8;

/*Data for the table `tipo_estudio` */

LOCK TABLES `tipo_estudio` WRITE;

insert  into `tipo_estudio`(`id`,`descripcion`) values (1,'Primaria'),(2,'Bachiller'),(3,'Técnico'),(4,'Tecnólogo'),(5,'Profesional'),(6,'Posgrado'),(7,'Bachiller Técnico'),(8,'No Definido');

UNLOCK TABLES;

/*Table structure for table `tipo_identificacion` */

DROP TABLE IF EXISTS `tipo_identificacion`;

CREATE TABLE `tipo_identificacion` (
  `codi_iden` varchar(60) NOT NULL COMMENT 'Identificación de la persona',
  `desc_iden` varchar(50) NOT NULL DEFAULT '',
  `abre_iden` varchar(2) DEFAULT NULL,
  `estado` int(11) DEFAULT '0',
  PRIMARY KEY (`codi_iden`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `tipo_identificacion` */

LOCK TABLES `tipo_identificacion` WRITE;

insert  into `tipo_identificacion`(`codi_iden`,`desc_iden`,`abre_iden`,`estado`) values ('0','No Registra','NR',0),('1','Tarjeta de Identidad','TI',1),('2','Documento de identidad extranjera','DE',1),('3','Pasaporte','PS',1),('4','Cédula de Extranjería','CE',1),('5','Visa','VA',1),('6','Cédula de Ciudadanía','CC',1),('7','Tarjeta Profesional','TP',1),('8','Número de Identificación Tributaria (NIT)','NI',0);

UNLOCK TABLES;

/*Table structure for table `user_roles` */

DROP TABLE IF EXISTS `user_roles`;

CREATE TABLE `user_roles` (
  `id_user` varchar(60) NOT NULL,
  `id_rol` int(11) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  KEY `FK_user_roles` (`id_rol`),
  KEY `FK_user_roles_u` (`id_user`),
  CONSTRAINT `FK_user_roles` FOREIGN KEY (`id_rol`) REFERENCES `roles` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `FK_user_roles_u` FOREIGN KEY (`id_user`) REFERENCES `users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `user_roles` */

