/* Function  structure for function  `getEdad` */

/*!50003 DROP FUNCTION IF EXISTS `getEdad` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `getEdad`(id_pers varchar(60)) RETURNS int(11)
BEGIN

SET @edad = '';

	SELECT TIMESTAMPDIFF(YEAR, fnac_pers, NOW()) INTO @edad FROM persona WHERE id=id_pers;

	RETURN @edad;

END */$$
DELIMITER ;

