/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `todo` AS select `persona`.`id` AS `dni`,`persona`.`nomb_pers` AS `nombre`,`persona`.`ape_pers` AS `apellido`,`persona`.`sexo` AS `sexo`,`persona`.`fnac_pers` AS `fecha_nac`,`persona`.`esta_pers` AS `estado`,`persona`.`telefono1` AS `tel1`,`persona`.`telefono2` AS `tel2`,`persona`.`emai_pers` AS `correo`,`persona`.`direccion` AS `dir`,`persona`.`id_cat` AS `categoria`,`persona`.`foto_pers` AS `foto_pers`,`persona_datos_academicos`.`nivel_educativo` AS `nivel`,`persona_datos_academicos`.`estado` AS `estadoE`,`persona_datos_academicos`.`titulo` AS `titulo`,`persona_datos_profesionales`.`id_categoria` AS `id_categoria`,`persona_datos_profesionales`.`id_perfil` AS `id_perfil`,`persona_datos_profesionales`.`descripcion` AS `descripcion`,`persona_datos_academicos_plus`.`cursos` AS `cursos`,`persona_datos_academicos_plus`.`id_idioma` AS `id_idioma`,`persona_datos_academicos_plus`.`n_idioma` AS `n_idioma`,`persona_experiencia_profesional`.`nomb_empresa` AS `nomb_empresa`,`persona_experiencia_profesional`.`cargo` AS `puesto`,`persona_experiencia_profesional`.`funciones` AS `funciones`,`persona_experiencia_profesional`.`fecha_ini` AS `fecha_ini`,`persona_experiencia_profesional`.`fecha_fin` AS `fecha_fin` from ((((`persona` join `persona_datos_academicos` on((`persona`.`id` = `persona_datos_academicos`.`id`))) join `persona_datos_profesionales` on((`persona`.`id` = `persona_datos_profesionales`.`id`))) join `persona_datos_academicos_plus` on((`persona`.`id` = `persona_datos_academicos_plus`.`id`))) join `persona_experiencia_profesional` on((`persona`.`id` = `persona_experiencia_profesional`.`id`))) */;

